import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class Legal extends Component {
  render () {
    return (
      <div>
      <div className='navbar2'>
      <NavLink to="/legal" className="navButton"> Legal </NavLink>
      </div>
      </div>
    )
  }
}

export default Legal
